import React, {Fragment} from 'react';
import styled from 'styled-components';

import Header from '../../components/Header';
import Footer from '../../components/Footer';

const Container = styled.div`
	text-align: center;
	padding-top
	height: 700px;
`;

const Heading = styled.h1`
	color: #00aaf4;
	font-size: 153px;
	line-height: 153px;
	margin: 0;
	font-weight: bold;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
	display: block;
`;

const SubHeading = styled.p `
	color: #00aaf4;
	font-size: 45px;
	margin: 0 0 60px 0px;
	font-weight: bold;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
`;

const SpeakerImg = styled.img `
	vertical-align: top;
`;

const PriceBlock = styled.div`
	display: inline;
	border-top: 1px solid #828e96;
	border-bottom: 1px solid #828e96;
	padding-top: 75px;
	padding-bottom: 70px;
`;

const Price = styled.p`
	vertical-align: top;
	display: inline;
	font-size: 155px;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
	line-height: 155px;
	color: #828e96;
	padding: 0 20px;
`;

const Hyper = styled.span`
	font-size: 96px;
	line-height: 120px;
`;



const price = (props) => (
	<Fragment>
		<Header />
		<Container>

				<Heading>JBL Xtreme 2</Heading>
				<SubHeading>waterproof portable bluetooth speaker</SubHeading>
				<div>
					<SpeakerImg src="assets/images/xtreme2-group.png" alt="Three JBL Xtreme 2 speakers."/>
					<PriceBlock>
						<Price><Hyper>$</Hyper>299<Hyper class="hyper">99</Hyper></Price>
					</PriceBlock>
				</div>

		</Container>
		<Footer />
	</Fragment>
)

export default price;
